import styled from 'styled-components';
import Masthead from './Masthead';

const Card = styled.div`
  background: #ffffff;
  border-radius: 2px;
  position: relative;
  box-shadow: 2px 2px 4px 0px #cfd8dc;
`;

Card.Masthead = Masthead;

export default Card;
